// SPDX-License-Identifier: MIT
pragma solidity 0.6.12;

import "../../interfaces/ISettings.sol";
import "../openzeppelin/contracts/access/Ownable.sol";
import "../openzeppelin/contracts/token/ERC20/SafeERC20.sol";
import "../../interfaces/IVaultchef.sol";


pragma experimental ABIEncoderV2;

contract PolycatStrategy is Ownable {
    using SafeERC20 for IERC20;
    using SafeMath for uint256;


    struct Pools {
        address token;
        uint256 poolId;
    }

    IVaultchef public VaultChef;
    ISettings public Settings;

    address[] public tokens;
    mapping(address => bool) internal _tokens;

    mapping(address => uint256) public poolIds;

    mapping(address => uint256) public totalDeposits;

    mapping(address => uint256) public vaultDeposits;


    modifier onlyVault {
        require(Settings.vault(msg.sender), "CornFi AAVE Strategy: Vault Only Function");
      _;
   }


    constructor(IVaultchef _vaultChef, ISettings _settings, Pools[] memory _pools) public {
        VaultChef = _vaultChef;
        Settings = _settings;
        for(uint i = 0; i < _pools.length; i++) {
            _addPool(_pools[i].token, _pools[i].poolId);
        }
    }


    function addPool(Pools memory _pool) public onlyOwner {
        _addPool(_pool.token, _pool.poolId);
    }


    function _addPool(address _token, uint256 _poolId) internal {
        //require(VaultChef.poolInfo(_poolId).want.address == _token);
        poolIds[_token] = _poolId;
        if(!_tokens[_token]) {
            tokens.push(_token);
            _tokens[_token] = true;
        }
    }


    function deposit(address _from, address _token, uint256 _amount) public onlyVault {
        require(poolIds[_token] != 0);
        if(_amount > 0) {
            IERC20(_token).transferFrom(_from, address(this), _amount);

            // Approve Aave lending pool to take (deposit) a token
            IERC20(_token).approve(address(VaultChef), _amount);

            // Deposit assets into Aave lending pool
            VaultChef.deposit(poolIds[_token], _amount);

            totalDeposits[_token] = totalDeposits[_token].add(_amount);
            vaultDeposits[_token] = vaultDeposits[_token].add(_amount);
        }
    }


    function withdraw(address _from, address _token, uint256 _amount) public onlyVault {
        require(poolIds[_token] != 0);

        // This prevents the owner from creating a malicious vault that could withdraw all tokens
        require(_amount <= vaultDeposits[_token], "CornFi Polycat Strategy: Vault Withdraw Amount Exceeded");

        VaultChef.harvest(poolIds[_token], Settings.feeAddress());

        if(_amount > 0) {
            VaultChef.withdraw(poolIds[_token], _amount);
            totalDeposits[_token] = totalDeposits[_token].sub(_amount);
            vaultDeposits[_token] = vaultDeposits[_token].sub(_amount);
        }
    }


    function claimRewards() public onlyOwner {
        for(uint i = 0; i < tokens.length; i++) {
            VaultChef.harvest(poolIds[tokens[i]], Settings.feeAddress());
        }
    }
}
